import hashlib


def listToString(list):
    result = ""
    for i in list:
        result += str(list[i])
    return result

def stringToList(string):
    result = []
    for i in string:
        result.append(int(i))
    return result



list1 = [1, 1]
list2 = [2, 2]

list3 = list1 + list2


print(list3)
print(listToString(list3))
print(stringToList(listToString(list3)))
print(list3[:3])
concat = ""
print(len(concat))
cipher = hashlib.sha256(concat.encode('utf-8')).hexdigest()
print(cipher)